// (true)
bool monotonic(std::vector<long> l) {
    if (l.size() == 0) {
        return true;
    }
    long prev = l[0];
    for (long i = 1; i < l.size(); i++) {
        if (l[i] == prev) {
            continue;
        }
        if (l[i] > prev) {
            for (long j = i + 1; j < l.size(); j++) {
                if (l[j] < l[j - 1]) {
                    return false;
                }
            }
            return true;
        }
        if (l[i] < prev) {
            for (long j = i + 1; j < l.size(); j++) {
                if (l[j] > l[j - 1]) {
                    return false;
                }
            }
            return true;
        }
    }
    return true;

