// brackets is a string of "(" and ")".
// return true if every opening bracket has a corresponding closing bracket.
// >>> correct_bracketing(("("))
// (false)
// >>> correct_bracketing(("()"))
// (true)
// >>> correct_bracketing(("(()())"))
// (true)
// >>> correct_bracketing((")(()"))
// (false)
bool correct_bracketing(std::string brackets) {
  std::stack<char> stack;
  for (auto bracket : brackets) {
    if (bracket == '(') {
      stack.push(bracket);
    } else {
      if (stack.empty()) {
        return false;
      }
      stack.pop();
    }
  }
  return stack.empty();

