// ("tHKS KS C MGSSCGG")
std::string encode(std::string message) {
  std::string encoded_message;
  for (char c : message) {
    if (c >= 'a' && c <= 'z') {
      if (c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u') {
        c = (c + 2) % 26 + 'a';
      }
      c = (c - 'a' + 26) % 26 + 'A';
    }
    encoded_message += c;
  }
  return encoded_message;

