// The function should return true if and only if there is a valid subsequence of brackets 
// where at least one bracket in the subsequence is nested.
// >>> is_nested(("[[]]"))
// (true)
// >>> is_nested(("[]]]]]]][[[[[]"))
// (false)
// >>> is_nested(("[][]"))
// (false)
// >>> is_nested(("[]"))
// (false)
// >>> is_nested(("[[][]]"))
// (true)
// >>> is_nested(("[[]][["))
// (true)
bool is_nested(std::string string) {
  std::stack<char> stack;
  for (auto c : string) {
    if (c == '[') {
      stack.push(c);
    } else {
      if (stack.empty()) {
        return false;
      }
      stack.pop();
    }
  }
  return stack.empty();

