// first and last digits of a number are odd (1, 3, 5, 7, 9).
// For example:
// >>> specialFilter((std::vector<long>({(long)15, (long)-73, (long)14, (long)-15})))
// (1)
// >>> specialFilter((std::vector<long>({(long)33, (long)-2, (long)-3, (long)45, (long)21, (long)109})))
// (2)
long specialFilter(std::vector<long> nums) {
    long count = 0;
    for (long i : nums) {
        if (i > 10) {
            if ((i / 10) % 10 % 2 == 1 && i % 10 % 2 == 1) {
                count++;
            }
        }
    }
    return count;

